import React from "react";

const Books = ({ books, loading }) => {
    if(loading) {
        return <h2>Loading...</h2>
    }
    
    return <ul className="list-group mb-4">
        {books.map(book => (
            <li key={book._id} className="list-group-item">
                {book.titulo}
            </li>
        ))}
    </ul>
}

export default Books
